export type MonsterType = {
	img: string;
	name: string;
	stats?: {
		str: number;
		dex: number;
		con: number;
		int: number;
		wis: number;
		cha: number;
	};
	hp: number;
	ac: number;
	speed: number;
	actions?: [
		{
			name: string;
			description: string;
			toHit: number;
			damageDie: string;
			damageBonus: number;
		}
	];
};

